<!DOCTYPE html>
<html lang="en-us">
<head>
<title>Grcov report</title>
<link rel="stylesheet" href="grcov.css">
<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
</head>
<body>
<div class="header">
<div class="view">
<div class="viewRow"><span class="viewItem">Current view:</span><span class="viewValue">top level</span></div>
<div class="viewRow"><span class="viewItem">Date:</span><span class="viewValue">2021-04-09 12:12:14</span></div>
</div>
<div class="stats">
<div class="statsRow"><span></span><span class="statsHit">Hit</span><span class="statsTotal">Total</span><span class="statsCoverage">Coverage</span></div>
<div class="statsRow"><span class="statsLine">Lines</span><span class="linesHit">0</span><span class="linesTotal">0</span><span class="linesPercentage lineLow">0.0 %</span></div>
<div class="statsRow"><span class="statsFun">Functions</span><span class="funsHit">0</span><span class="funsTotal">0</span><span class="funsPercentage funLow">0.0 %</span></div>
<div class="statsRow"><span class="statsBranches">Branches</span><span class="branchesHit">0</span><span class="branchesTotal">0</span><span class="funsPercentage branchLow">0.0 %</span></div>
</div>
</div>
<div class="dirStatsHeader"><div class="dirStatsLineHeader"><span class="dirNameHeader">Directory</span><span class="dirLineCovHeader">Line Coverage</span><span class="dirFunsHeader">Functions</span><span class="dirBranchesHeader">Branches</span></div></div>
<div class="dirStats">
</div>
</body>
</html>
